  <script type="module">
    import {SvgPath, SvgPlus, Vector} from "./4.js";
    import {run} from "./fillCheckers.js";
    import {Group} from "../EmbApp/STree/stitch-nodes.js";

    let svg = new SvgPath("Layer_1");
    let paths = svg.querySelectorAll("path");
    for (let path of paths) new SvgPath(path);
    // path.makeAbsolute();

    function inFill(p) {
      let fill = false;
      for (let child of paths) {
        if (child.getAttribute("class") == "cls-1") {
          if (child.isVectorInFill(p))  return false;
        } else {
          if (child.isVectorInFill(p)) fill = true;
        }
      }
      return fill
    }

    let vb = svg.getBBox();
    let pos = new Vector(vb).floor();
    let size = new Vector(vb.width, vb.height).ceil();
    svg.createChild("rect", {
      x: pos.x,
      y: pos.y,
      width: size.x,
      height: size.y
    });

    let output = svg.createChild(Group);
    let visual = output.makeGroup();
    run(pos, pos.add(size), inFill, visual)


  </script>
